import React from 'react';
import image from './img/Fort.png';
import { Helmet } from "react-helmet";
import Slider from "react-slick";
import Divider from '../image/SwirlDivider.png';

import CatagoriesList from './CatagoriesList.js';

/* import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css"; */

const myPage = {
	// Scroll to the block
	scrollThere: function(targetElement, speed) {
	  var _self = this;
	  $("html, body")
		.stop()
		.animate(
		  {
			scrollTop: targetElement.offset().top
		  },
		  {
			duration: speed,
			complete: function() {
			  _self.setViewportClasses(); // On complete set viewport classes
			}
		  }
		);
	},
  
	//Check if element is in the viewport
	isInViewport: function(element) {
	  var _self = this;
	  // check for the section which is the main currently
	  var elementMiddle = element.offset().top + element.outerHeight() / 2;
	  var viewportTop = $(window).scrollTop();
	  var viewportBottom = viewportTop + $(window).height();
	  return elementMiddle > viewportTop && elementMiddle < viewportBottom;
	},
  
	// Set classes for the current element, prev and next
	setViewportClasses: function() {
	  var _self = this;
	  // add classes for main, prev and next sections
	  $(".inView").removeClass("inView");
	  $(".prev-inView").removeClass("prev-inView");
	  $(".next-inView").removeClass("next-inView");
	  $(".section").each(function(i, obj) {
		if (_self.isInViewport($(this))) {
		  $(this).addClass("inView");
		  if ($(this).prev())
			$(this)
			  .prev()
			  .addClass("prev-inView");
		  if ($(this).next())
			$(this)
			  .next()
			  .addClass("next-inView");
		  return false;
		}
	  });
  
	  // Make colors darker
	  $(".inView").css("opacity", "1");
	  $(".prev-inView").css("opacity", "0.3");
	  $(".next-inView").css("opacity", "0.3");
	},
  
	initEvents: function() {
	  var _self = this;
	  $(window)
		.off()
		.on("wheel", function(e) {
		  e.preventDefault;
		  if (e.originalEvent.wheelDelta > 0 || e.originalEvent.detail < 0) {
			//scroll up
			if ($(".prev-inView").length > 0)
			  _self.scrollThere($(".prev-inView"), 500);
		  } else {
			//scroll down
			if ($(".next-inView").length > 0)
			  _self.scrollThere($(".next-inView"), 500);
		  }
		});
	},
  
	init: function() {
	  var _self = this;
	  _self.setViewportClasses();
	  _self.initEvents();
	}
  };
  
  myPage.init();
  
function Catagories() {
	const settings = {
		className: "center",
		infinite: true,
		centerPadding: "60px",
		slidesToShow: 5,
		focusOnSelect: true,
		slidesToScroll:4,
		swipeToSlide: true,
		// dots: true,


		afterChange: function (index) {
			console.log(
				`Slider Changed to: ${index + 1}, background: #222; color: #bada55`
			);
		}
	};
	
	return (
		<div>

			<Helmet>
				<script src="./assets/js/hovers.js"></script>
				<script src="./assets/js/snap.svg-min.js"></script>
				<link rel="stylesheet" type="text/css" href="./assets/css/slick-theme.css" />
		<link rel="stylesheet" type="text/css" href="./assets/css/slick.css" />
			</Helmet>
			<div class="container">


				<header class="codrops-header" id="Mycatagories" >
					<h1>Catagories</h1>
					<img src={Divider} alt="Caption Divider" style={{ width: '150px', height: '25px', marginLeft: '0px' }} />
				</header>

				<section id="section-1" class="grid clearfix">

					<Slider {...settings} >
						
						<a href="/#" data-path-hover="m 180,34.57627 -180,0 L 0,0 180,0 z">
							<figure>
								<img src={image} alt='one' />
								<svg viewBox="0 0 180 320" preserveAspectRatio="none"><path d="M 180,160 0,218 0,0 180,0 z" /></svg>
								<figcaption>
									<h2>Rarebook</h2>
									<p>Lorem Ipsum is simply dummy text of the printing and typesetting industry.</p>
									<button>View</button>
								</figcaption>
							</figure>
						</a>
						<a href="/#" data-path-hover="m 180,34.57627 -180,0 L 0,0 180,0 z">
							<figure>
								<img src={image} alt='one' />
								<svg viewBox="0 0 180 320" preserveAspectRatio="none"><path d="M 180,160 0,218 0,0 180,0 z" /></svg>
								<figcaption>
									<h2>Photo Eassy</h2>
									<p>Lorem Ipsum is simply dummy text of the printing and typesetting industry.</p>
									<button>View</button>
								</figcaption>
							</figure>
						</a>
						<a href="/#" data-path-hover="m 180,34.57627 -180,0 L 0,0 180,0 z">
							<figure>
								<img src={image} alt='three' />
								<svg viewBox="0 0 180 320" preserveAspectRatio="none"><path d="M 180,160 0,218 0,0 180,0 z" /></svg>
								<figcaption>
									<h2>E-Book</h2>
									<p>Lorem Ipsum is simply dummy text of the printing and typesetting industry.</p>
									<button>View</button>
								</figcaption>
							</figure>
						</a>
